a5sim9y17u3f8pjejoq4sk7nkxy	2025-07-21 03:48:08.619072+00	ckmqrczg4ttbo38ts8zssp9nfir	1	text	After you've copied the link, paste it into any channel or Direct Message to share the card. A preview of the card will display within the channel with a link back to the card on Boards.	{}	1753069688717	1753069688717	0	\N	system		system	bkssrad3ofjbi8qbk7ngisc85ry
a93pux4mxb7yqjmopw9p7fc75wo	2025-07-21 03:48:08.619072+00	ckmqrczg4ttbo38ts8zssp9nfir	1	text	To share a card, you'll need to copy the card link first. You can:\n\n- Open a card and select the options menu button at the top right of the card.\n- Open the board view and hover your mouse over any card to access the options menu button.	{}	1753069688718	1753069688718	0	\N	system		system	bkssrad3ofjbi8qbk7ngisc85ry
