aytzjwxo8mjgybepzh93zgcdeue	2025-07-21 03:48:08.619072+00	cmhxqxsy85trhirqewu7cryfone	1	text	Customize cards to fit your needs and track the information most important to you. Boards supports a wide range of fully customizable property types. For example, you can:\n- Use the **Date** property for things like deadlines or milestones.\n- Assign owners to tasks with the **Person** property.\n- Define statuses and priorities with the **Select** property.\n- Create tags with the **Multi Select** property.\n- Link cards to webpages with the **URL** property.	{}	1753069688728	1753069688728	0	\N	system		system	bkssrad3ofjbi8qbk7ngisc85ry
