atqhmzrs5mtrwxp3q5jckwgtk9w	2025-07-21 03:48:08.619072+00	cozqwinehpfbouyhftip9u7y41r	1	text	To mention a teammate use the **@ symbol with their username** in the comments or description section. They'll get a Direct Message notification via Channels and also be added as a [follower](https://docs.mattermost.com/boards/work-with-cards.html#receive-updates) to the card. \n\nWhenever any changes are made to the card, they'll automatically get notified on Channels.	{}	1753069688733	1753069688733	0	\N	system		system	bkssrad3ofjbi8qbk7ngisc85ry
